$dt = new BotStatusBot\DataLogger();

$WH = new BotStatusBot\WikiaHelper();
$WH->init($_LGTOKEN, $_LGNAME, $_LGPASSWORD);

$WH->logIn();

foreach ($img_n2_link_image_repo_desc as $key => $entry) {

    $botname = $entry[1];

    $dt->logdata($botname);

    $image = $entry[0].'.png';
    $page_link = $entry[2];
    $description = $entry[5];

    $extra_data = $WH->getExtraData($botname);

    $botdata = array(
        'botname' => $botname,
        'description' => $description,
        'status' => $extra_data['status'],
        'facebook_url' => $page_link,
        'image' => $image,
        'imagecaption' => '',
        'botmins' => '',
        'type' => $extra_data['type'],
        'creation' => ''
    );

    $built_data = $WH->buildDataForArticle($botdata, 'bot');

//    if($key > 10) {
//        return;
//    }

    // Sleep every 10 bots for good measure
    if($key % 10 == 0) {
        sleep(3);
    }

    $success = $WH->automatedArticle($built_data, FALSE, FALSE);
    if ($success) {
        $dt->logdata($botname.' article created');
    } else {
        $dt->logdata($botname.' article creation failed');
    }

}
